            function checkQtyForm() {
                var count = 0;
                $(".qtyInput").each(function () {
                    count += parseInt($(this).val());
                });
                if (count == 0) {
                    alert("Please select products..");
                    return false;
                }

				cuts = false;

				$("input.cusname").each(function () {
					if ($(this).val() == "" && $(this).attr("name") == "id[txt_2]") {
						alert("Customized Name is not empty");
						cuts = true;
						return;
					} else if ($(this).val() == "" && $(this).attr("name") == "id[txt_3]" && cuts != true) {
						alert("Customized Number is not empty");
						cuts = true;
						return;
					} else if ($(this).attr("name") == "id[txt_3]" && isNaN($(this).val()) && cuts != true) {
						alert("Customized Number Must be a digital");
						cuts = true;
						return;
					}
				});

				if (cuts) {
					return false;
				}

                return true;
            }

li.script:
             jQuery(function($) {
		$(".cosTab").click(function() {
			$(".cosTab").each(function() {
				$(this).parent().find("div").slideUp();
				$(".cos-listView a span").removeClass("aa")
			});
			if ($(this).parent().find("div").css("display") == "block") {
				return false;
			}
			else {
				$(this).parent().find("div").slideDown();
				$(this).find("span").addClass("aa")
			}
			console.log($(this).parent().find("div").css("display"));
		});
	});

